But first, I wanna chat about the #foottripod üî∫as I discussed with my #JLdailyFitVIP this morning - The foot tripod concept is a useful way of thinking about how to evenly distribute weight on the foot and because its LEG DAY, i want to drive this tip home in today‚Äôs post :) 
The tripod refers to 3Ô∏è‚É£ points of contact that the bottom of the foot makes with the ground.
üìçCenter of the calcaneus (heel)
üìçHead of the 5th metatarsal
üìçHead of the 1st metatarsal
{Swipe to the last photo for visual}
A balance between these points gives the foot stability. It‚Äôs also thought that the arches of the foot function optimally when the tripod position is maintained... a collapsed arch tends to put excessive strain on the outside of that knee (I know this from experience in my left leg)  while a "rolling out" position of the foot strains the inner portion of the knee joint.
